def html(
    body: Union[str, bytes, HTMLProtocol],
    status: int = 200,
    headers: Optional[Dict[str, str]] = None,
) -> HTTPResponse:
    """
    Returns response object with body in html format.

    :param body: str or bytes-ish, or an object with __html__ or _repr_html_.
    :param status: Response code.
    :param headers: Custom Headers.
    """
    if isinstance(body, HTMLProtocol):
        return HTTPResponse(body.body, status, headers)
    elif isinstance(body, str):
        return HTTPResponse(body.encode(), status, headers)
    elif isinstance(body, bytes):
        return HTTPResponse(body, status, headers)
    else:
        raise TypeError(f"Invalid body type: {type(body)}")
